Adobe FrameMaker 10 

Adobe FrameMaker 10 software is a template-based authoring and publishing solution for unstructured, structured and XML/DITA content.  Easily author content with an enhanced user interface and standards-compliant tools, collaborate and review with out-of-the-box content management system (CMS) integration, and automatically schedule and publish via Adobe FrameMaker Server 10 software to multiple channels such as PDF, HTML, WebHelp, Adobe Air, Adobe FlashHelp, and Oracle Help.

